package mkl.testarea.itext7.content;

import static com.itextpdf.kernel.xmp.XMPUtils.decodeBase64;

import org.junit.BeforeClass;
import org.junit.Test;

import com.itextpdf.io.image.ImageData;
import com.itextpdf.io.image.ImageDataFactory;
import com.itextpdf.kernel.xmp.XMPException;

/**
 * @author mkl
 */
public class ImageDataRetrieval {

    /**
     * @throws java.lang.Exception
     */
    @BeforeClass
    public static void setUpBeforeClass() throws Exception {
    }

    /**
     * <a href="https://stackoverflow.com/questions/60990686/png-image-is-getting-corrupted-in-itext7">
     * PNG image is getting corrupted in Itext7
     * </a>
     * <br/>
     * <a href="https://gist.github.com/nil96/d9d54200e5329211d2d7455492716500">
     * gist of image data URL
     * </a>
     * <p>
     * Analyzing the data returned by <code>imageData.getData()</code>
     * shows that those data do not only contain -1 values but others,
     * too. But as the image is white with a bit of darker scribble,
     * there indeed is a lot of 255 (= -1), 254 (= -2), ... and only a
     * small amount of smaller unsigned values.
     * </p>
     */
    @Test
    public void testRetrieveLikeNil96() throws XMPException {
        String orignalImage = "data:image/png;base64,";
        String base64Image = orignalImage.replaceFirst("data:image/png;base64,","");
        byte[] decodedBytes = decodeBase64(base64Image);
        ImageData imageData = ImageDataFactory.create(decodedBytes,true);
        byte[] bytes = imageData.getData();

        int[] count = new int[256];
        for (int i=0; i<bytes.length; i++) {
            count[255 & (int)bytes[i]]++;
        }

        for (int i = -128; i < 128; i++) {
            if (i%16 == 0)
                System.out.printf("\n%4d: ", i);
            System.out.printf("%6d ", count[255&i]);
        }
        System.out.println();
    }

}
